import { LOAD_ALL_REQUESTS } from "../actions/requests/action-type"

const initialState = {
    list: []
}

export default function RequestsReducer(state = initialState, action) {
    switch(action.type){
        case LOAD_ALL_REQUESTS :
            return {list: action.payload}
        break

        default : return state
    }
}
